import { registerThemeProperties } from "@ui5/webcomponents-base/dist/asset-registries/Themes.js";

import defaultThemeBase from "@ui5/webcomponents-theme-base/dist/generated/themes/sap_fiori_3/parameters-bundle.css.js";
import defaultTheme from "./sap_fiori_3/parameters-bundle.css.js";

registerThemeProperties("@ui5/webcomponents-theme-base", "sap_fiori_3", defaultThemeBase);
registerThemeProperties("@ui5/webcomponents", "sap_fiori_3", defaultTheme);
export default ":host{display:contents}:host .ui5-table-column-root{padding:.25rem;box-sizing:border-box}th{background:var(--sapList_HeaderBackground);border-bottom:1px solid var(--sapList_BorderColor);border:none;width:inherit;font-weight:400}.ui5-table-column-root{display:flex;height:3rem;justify-content:flex-start;align-items:center}:host([first]) .ui5-table-column-root{padding-left:1rem}:host([sticky]) th{position:sticky;top:0;z-index:999}";
